import React, {Component} from 'react'
import Navbar from './Navbar';

class App extends Component {
    render(){
        return(
            <div>
            <div>
                <Navbar/>
            </div>
            <div>
                <h1>Hello World!</h1>
            </div>
            </div>
        )
    }
}

export default App;
